import classes from './InstructorBar.module.css';
import seema from './profSeema.png'
import {MdStopCircle} from 'react-icons/md';
import {BsPeopleFill} from 'react-icons/bs'

const InstructorBar=(props)=>{


console.log("course: ", props.selectedCourse.enrolledstudents[0]);

return (

<div className={classes.instructorBar}>

   <i > <span> INSTRUCTOR</span>  
	<span>  <BsPeopleFill className={classes.participantIcon}/> 
	   <span className={classes.numParticipant}>  
	      {props.selectedCourse.length>0 && props.selectedCourse.enrolledstudents}
	   </span> 
	   <span className={classes.statusSpan}>STATUS: <b  className={classes.cStatus}> Ongoing</b> </span>
	</span>  
   </i>
   <button >Prof. Seema Bahinipati  <img className={classes.instructorImage} src={seema} alt='edr Logo' /> </button> 




</div>

);

}

export default InstructorBar;
